import { Container, Name, Username, Description, Id, URL } from "./styles";

const UserDetails = (props) => (
    <Container>
        <Name>{props.name}</Name>
        <Username>
            {props.login} #{props.id}
        </Username>

        <Description>{props?.bio}</Description>
    </Container>
);

export default UserDetails;
